import React from 'react';
import './RandomYouTubeVideo.css';


class RandomYouTubeVideo extends React.Component {
  render() {
    return (
      <div className="holder">
        <iframe className="video" src="https://www.youtube-nocookie.com/watch?v=DGZCOjj4w9w" frameborder="0" allow="accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture" allowFullScreen="true"></iframe>
        <h1>Cousin's Clip: At London</h1>
      </div>
    );
  }
}

export default RandomYouTubeVideo;
